import ReactDOM from 'react-dom';
import './index.css'; // Eğer bir CSS dosyanız yoksa bu satırı silebilirsiniz
import WebSocketComponent from './components/WebSocketComponent';

ReactDOM.render(
    <React.StrictMode>
        <WebSocketComponent />
    </React.StrictMode>,
    document.getElementById('root')
